0.ds_documentacao:
Documentação comum a todos os candidatos (ampla concorrência e cotistas) - Cópia nítida, acompanhada do original, de: a. Certidão de Nascimento ou Casamento; 
b. Carteira de Identidade; 
c. CPF; 
d. Comprovante de endereço; 
e. Ficha de matrícula preenchida (modelo anexo VIII e site do IFCE); 
f. Certificado de quitação com o serviço militar, se do sexo masculino e maior de 18 anos;
g.Título de Eleitor com comprovante de votação da última eleição, se maior de 18 anos (CF/88.Art.14 §1º, I); 
h. Histórico escolar e certificado de conclusão do ensino médio ou equivalente (curso técnico de nível médio; magistério; certificado de conclusão do ensino médio com base no resultado do Exame Nacional do Ensino Médio - ENEM, ou de exame nacional para certificação de competências de jovens e adultos ou de exames de certificação de competência ou de avaliação de jovens e adultos realizados pelos sistemas estaduais de ensino); 
i. 02 fotos 3x4 recentes e iguais

